(()=>{let e={cityname:document.querySelector(".cityName"),search:document.querySelector(".search"),temp:document.querySelector(".temp"),humidity:document.querySelector(".humidity"),wind:document.querySelector(".wind")};e.search.addEventListener("click",(function(){var t;t=e.cityname.value,fetch(`http://api.openweathermap.org/data/2.5/weather?q=${t}&units=metric&appid=2aa31b1d167d0f8341bd55e8c2aba6ae`,{mode:"cors"}).then((function(e){return e.json()})).then((function(t){e.temp.textContent="Temperature:"+t.main.temp+" C",e.humidity.textContent="Humidity:"+t.main.humidity+" %",e.wind.textContent="Wind:"+t.wind.speed+" km/h"}))}))})();